  const [title, setTitle] = useState('title');

  useEffect(() => {
    axios.get('https://jsonplaceholder.typicode.com/post/1')
      .then(resp => {
        console.log(title);
        setTitle(title);
      })
  })

  return (
    <div className="App">

    </div>
  );
}

export default App;
